24 saat kamera nəzarəti;
Geniş və səliqəli həyət;
Kodlaşdırılmış giriş-çıxış;
Mərmər bloklar;
Daimi Qaz,İşıq və Su təminatı;
Müasir tələblərə uyğun lift;
Yanğın təhlükəsizlik sistemi;
Yaxınlıqda uşaq baxçası və məktəb; Çanaqqala və Gilavar restoranları;
Ticarət və xidmət obyektlərı mövcuddur. Ətraflı Telefonla.
Şirkətin xidmət haqqı 1%

